// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../know-token/KnowlageToken.sol";
import "../know-proxy/TokenProxy.sol";
import "../know-template/SubjectTemplate.sol";

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

/**
 * @title Major Factory Contract
 * @notice HorseRace is a NFT horse racing metaverse based on pylogon
 * @notice ....
 *
 * @notice Website: https://horse-racing.io/
 * @notice Docs: https://horse-racing.gitbook.io/horse-racing-docs/
 * 
 * @dev Version: v1.0.1
 */
contract MajorFactory is AccessControl, Pausable {
    using EnumerableSet for EnumerableSet.Bytes32Set;
    using EnumerableSet for EnumerableSet.AddressSet;

    /**
     * @notice Major Struct - Major Detail
     *
     * @dev majorURI The json URI of major detail
     * @dev status The status of major (0: Normal 1: Abnormal)
     * @dev subjects The subject contract address of major
     */
    struct Major {
        string majorURI; uint256 status; EnumerableSet.AddressSet subjects;
    }

    /**
     * @notice Subject Struct - Subject Detail
     *
     * @dev subjectURI The json URI of subject detail
     * @dev status The status of subject (0: Normal 1: Abnormal)
     */
    struct Subject { string subjectURI; uint256 status; }

    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    /** @notice The role of access control - (admin role) */
    bytes32 constant public ADMIN_ROLE = keccak256("ADMIN_ROLE");

    /** @notice Subject contract template address - For add new subject contract */
    address public subjectTemplate;

    /**
     * @notice Proxy Address List - (Upgradeable)
     *
     * @dev 0 - Address of token proxy contract - For subject mint token
     * @dev 1 - Address of transfer proxy contract - For subject transfer token
     * @dev 2 - Address of black list proxy contract - For subject black list
     * @dev 3 - Address of fee receiver proxy contract - For subject transfer fee
     * @dev 4 - Address of ticket lp token contract - For subject transfer ticket token
     */
    address[5] public proxys;

    /** @notice Major's id list - For get major uri list */
    EnumerableSet.Bytes32Set private _majorIds;

    /** @notice The map of all major. See { MajorFactory - Major } */
    mapping (bytes32 => Major) private _majors;

    /** @notice The map of all subject. See { MajorFactory - Subject } */
    mapping (address => Subject) private _subjects;

    event OpenMajor(bytes32 majorId, address admin, uint256 blockNumber);
    event ToggleMajorStatus(bytes32 majorId, address admin, uint256 status);
    event AddSubjectForMajor(address subject, address admin, uint256 blockNumber);
    event ToggleSubjectStatus(bytes32 majorId, address admin, address subject, uint256 status);


    constructor(address tmpl, address[5] memory addrs) {
        subjectTemplate = tmpl;
        proxys = addrs;

        _grantRole(ADMIN_ROLE, _msgSender());
    }

    /** @notice Get all major's json URIs */
    function getMajors() public view returns (string[] memory majors) {
        majors = new string[](_majorIds.length());

        for (uint256 index = 0; index < majors.length; index++) {
            bytes32 majorId = _majorIds.at(index);
            if (_majors[majorId].status != 0) continue;

            majors[index] = _majors[majorId].majorURI;
        }
    }

    function getSubjects(bytes32 majorId) public view returns (string[] memory subjects) {
        subjects = new string[](_majors[majorId].subjects.length());

        for (uint256 index = 0; index < subjects.length; index++) {
            address subject = _majors[majorId].subjects.at(index);
            if (_subjects[subject].status != 0) continue;

            subjects[index] = _subjects[subject].subjectURI;
        }
    }

    function setSubjectTemplate(address templ) public {
        require(hasRole(ADMIN_ROLE, _msgSender()), "ONLY_ADMIN");
        subjectTemplate = templ;
    }

    function openMajor(string memory majorURI) public {
        require(hasRole(ADMIN_ROLE, _msgSender()), "ONLY_ADMIN");
        bytes32 majorId = keccak256(abi.encode(majorURI));
        require(_majorIds.contains(majorId), "OPENED");

        _majorIds.add(majorId);
        _majors[majorId].majorURI = majorURI;

        emit OpenMajor(majorId, _msgSender(), block.number);
    }

    function toggleMajorStatus(bytes32 majorId, uint256 status) public {
        require(hasRole(ADMIN_ROLE, _msgSender()), "ONLY_ADMIN");
        require(!_majorIds.contains(majorId), "NOT_EXISTS");

        _majors[majorId].status = status;

        emit ToggleMajorStatus(majorId, _msgSender(), status);
    }

    function addSubjectForMajor(bytes32 majorId, string memory subjectURI) public {
        require(hasRole(ADMIN_ROLE, _msgSender()), "ONLY_ADMIN");
        require(!_majorIds.contains(majorId), "NOT_EXISTS");

        address newSubject = Clones.clone(subjectTemplate);
        SubjectTemplate(newSubject).initialize(_msgSender(), proxys, subjectURI);

        _majors[majorId].subjects.add(newSubject);
        _subjects[newSubject].subjectURI = subjectURI;

        // Grant mint role for subject contract
        address token = TokenProxy(payable(proxys[0])).getImplementation();
        KnowlageToken know = KnowlageToken(token);
        know.grantRole(know.MINTER_ROLE(), newSubject);

        emit AddSubjectForMajor(newSubject, _msgSender(), block.number);
    }

    function toggleSubjectStatus(bytes32 majorId, address subject, uint256 status) public {
        require(hasRole(ADMIN_ROLE, _msgSender()), "ONLY_ADMIN");
        require(!_majorIds.contains(majorId), "MAJOR_NOT_EXISTS");
        require(!_majors[majorId].subjects.contains(subject), "SUB_NOT_EXISTS");

        _subjects[subject].status = status;

        emit ToggleSubjectStatus(majorId, _msgSender(), subject, status);
    }
}

